import React, { Component } from 'react';

class FooterComponent extends Component {
    render() {
        return (
            <div>
                <footer className="f1">
                    <span className='text-muted'>All rights Reserved 2023 @YashalRailkar</span>
                </footer>
            </div>
        );
    }
}

export default FooterComponent;
